import React from "react";

function Contact() {
    return(
        <div>
            <form>
                <div className="form-group">
                    <label htmlFor="name">Your Name
                        <input type='text' id='name' name></input>
                    </label>
                </div>
            </form>
        </div>
    );
}

export default Contact;
